import Expenses from "./components/Expense";

function App() {
  const expenses = [
    {
      id: "e1",
      title: "Toilet Paper",
      amount: 67.5,
      date: new Date(2022, 4, 12)
    },
    {
      id: "e2",
      title: "Thariya",
      amount: 12.5,
      date: new Date(2022, 4, 12)
    },
    {
      id: "e3",
      title: "Paper Bags",
      amount: 89.4,
      date: new Date(2022, 4, 12)
    },
  ];

  return (
    <div>
      <Expenses item = {expenses}/>
    </div>
  );
}

export default App;
